import React from 'react';
import './App.css';

function Nav() {
  return (
      <nav> 
      	<h3> Logo </h3>
      	<ul className="nav-links">
      		<li> About </li>
      		<li> Inerview </li>
      	</ul>
      </nav>
  );
}

export default Nav;
